import Navbar from '../components/Nav';
import background from "../assets/top half background.png";
import "../App.css"

class Homepage extends Component {
  constructor(props) {
    super(props);
    this.state = {

    };
  }

  render() {
    return (
      <div >
        <Navbar/>
        <div style={{width:'100vw', height:'100vh', backgroundColor:'#02003d', position:'absolute',}}>
        <img src={background} alt="" style={{position:'absolute', zIndex:'0', width:'100%'}} className="topbackgroundImage"/>
        </div>


      </div>
    );
  }
}

export default Homepage;
